import React, { useState, useEffect } from "react";
import End from "./End";
import axios from "axios";

export default function Start(props) {
  const [data, setData] = useState([{}]);
  const [test, setTest] = useState("");

  function fetchData() {
    axios
      .get(
        "http://www.career.go.kr/inspct/openapi/test/questions?apikey=5894ecf675f64f28cd358b417ed6ad1b&q=6"
      )
      .then((response) => {
        const data = response.data.RESULT;
        setData(data);
      })
      .catch((Error) => {
        console.log(Error);
      });
  }
  useEffect(() => {
    fetchData();
  }, []);

  const onChangeTest = (e) => {
    setTest(e.target.value);
  };

  const changePage = () => {
    console.log("다음문항으로이동");
  };

  const [page, setPage] = useState(1);

  return (
    <>
      {/* <div>
        <button onClick={changePage}>냥냥</button>
        {page === 1 ? <Component1 /> : <Component2 />}
      </div> */}
      <div className="body-container">
        문항
        {data.map((jsondata, idx) => {
          console.log(jsondata);
          return (
            <>
              <div>
                <label>
                  <input
                    type="radio"
                    name={idx + 1}
                    value={jsondata.answer01}
                    onChange={onChangeTest}
                  />
                  {jsondata.answer01}
                </label>
                <label>
                  <input
                    type="radio"
                    name={idx + 1}
                    value={jsondata.answer02}
                    onChange={onChangeTest}
                  />
                  {jsondata.answer02}
                  setPage(page + 1)
                </label>
              </div>
              <br></br>
            </>
          );
        })}
        <button disabled={test == "" ? true : false} onClick={changePage}>
          제출
        </button>
        <br></br>
        <br></br>
      </div>
    </>
  );
}
